    "description" : "Online Marketplace",
    "created_at" : "Wed Jun 06 13:03:13 UTC 2007",
    "updated_at" : "Tue Sep 10 03:38:03 UTC 2013",
    "overview" : "<p>Founded in 1995 in San Jose, CA, eBay connects millions of buyers and sellers globally in the world&#8217;s largest online marketplace, utilizing <a href=\"/company/paypal\" title=\"PayPal\" rel=\"nofollow\">PayPal</a> to ensure secure transactions. The company also operates specialized marketplaces such as <a href=\"/company/stubhub\" title=\"StubHub\" rel=\"nofollow\">StubHub</a>, the world&#8217;s largest ticket marketplace, and eBay Classifieds sites, which together have a presence in more than 1,000 cities around the world. </p>\n\n<p>eBay items can be sold either via a silent auction, in which users input the maximum price they are willing to pay and for which the site will automatically increase bids as necessary up to that maximum, or via &#8220;Buy It Now,&#8221; with which they purchase items at a set price. </p>\n\n<p>eBay products and companies include eBay Marketplace, Media Marketplace, <a href=\"http://www.crunchbase.com/company/paypal\" title=\"PayPal\">PayPal</a>, <a href=\"http://www.crunchbase.com/company/half-com\" title=\"half.com\">half.com</a>, <a href=\"http://www.crunchbase.com/company/microplace\" title=\"MicroPlace\">MicroPlace</a>, <a href=\"http://www.crunchbase.com/company/shopping-com\" title=\"Shopping.com\">Shopping.com</a>, <a href=\"http://www.crunchbase.com/company/rent-com\" title=\"Rent.com\">Rent.com</a>, <a href=\"http://www.crunchbase.com/company/stubhub\" title=\"Stubhub\">Stubhub</a> and various online classifieds. </p>",
