    "tag_list" : "search, search-engine, human-powered-search, aaa",
    "alias_list" : "",
    "email_address" : "jason@mahalo.com",
    "phone_number" : "",
    "description" : "Life long learning content",
    "created_at" : "Thu Jun 14 03:42:20 UTC 2007",
    "updated_at" : "Fri May 17 04:34:19 UTC 2013",
    "overview" : "<p>Mahalo is a human powered search engine founded by Silicon Alley veteran entrepreneur Jason Calacanis.  Results are generated non-algorithmically by a team of profile builders who create pages for search terms.  Mahalo includes the most appropriate hand found links and information about for about 10,000 unique queries.  </p>\n\n<p>By 2008 the company hoped to reach 25,000 profiles.  Not unsurprisingly, search results are generated at a limited speed, because of the absence of an automated engine.  However, results pages are often very deep and useful.  Searching queries for which a page has not been created are supplemented with Google search results.  Theoretically, Google users shouldn&#8217;t have a problem switching over.</p>\n\n<p>Results pages are a mix between a traditional search layout and Wikipedia.  Any factual information is concisely listed to the side of the all links, while links results are split into different categories with the &#8220;top 7&#8221; heading up the page.  Results categories beyond the top 7 are decided upon by Mahalo guides.  These categories are tailored specifically to the search term.  Thus, a search for a person might include a professional profile, statistics for an athlete or a &#8220;gossip&#8221; section for celebrities.  Searches for companies generally include recent news, products or stock information.  Because search results are ultimately subjective, Mahalo allows users to submit their own links for consideration.  These links are voted on and eventually published or not.</p>\n\n<p>Although the manual creation process will force Mahalo to grow its index very slowly, founder Jason Calacanis claims the company can operate for <a href=\"http://www.techcrunch.com/2007/05/30/jason-calacanis-launches-mahalo-today-human-powered-search/\" title=\"four years without any revenue\">four years without any revenue</a>.</p>\n\n<p>Mahalo is one of a few substantially funded alternative search engines including <a href=\"http://crunchbase.com/company/powerset\" title=\"Powerset\">Powerset</a>, Hakia, <a href=\"http://crunchbase.com/company/wikia\" title=\"Wikia\">Wikia</a>, and <a href=\"http://crunchbase.com/company/chacha\" title=\"ChaCha\">ChaCha</a>.  <a href=\"http://crunchbase.com/company/wikipedia\" title=\"Wikipedia\">Wikipedia</a> can also be considered a competitor.</p>",
