    "overview" : "<p>OpenX is a global leader in digital and mobile advertising technology. OpenX’s vision is to unleash the full economic potential of digital media companies. OpenX solutions provide a unique Software as a Service platform by combining ad serving, an ad exchange, which includes Supply Side Platform technology, and content valuation.</p>\n\n<p>OpenX Technologies, Inc., a wholly owned subsidiary of OpenX Software Ltd., is based in Los Angeles and is backed by leading investors including Accel Partners, Index Ventures, SAP Ventures, and Samsung Venture Investment Corporation.</p>\n\n<p>For more information, please visit www.openx.com</p>\n\n<p>OpenX is a trademark of OpenX Limited. All other trademarks are the property of their respective owners.</p>",
