    "updated_at" : "Wed Apr 10 13:01:05 UTC 2013",
    "overview" : "<p>A company put together by Bessemer Venture Partners, Sparter was a virtual goods exchange for buying and selling virtual currencies in games like World of Warcraft (WOW), EverQuest, Eve and others.  Users would sign up and either buy or sell virtual currencies at market prices.</p>\n\n<p>Unlike other services, Sparter allowed users to both buy and sell cirtual currency. In late 2007 the average price for 100 gold in WOW was anywhere between $15 and $20.  Prices were proportional to delivery time (in world) and sellers average rating.</p>\n\n<p>As of May 15th the company removed the ability to place all new orders.</p>",
