    "description" : "Internet TV service",
    "created_at" : "Fri Aug 10 08:10:15 UTC 2007",
    "updated_at" : "Fri Mar 15 21:41:04 UTC 2013",
    "overview" : "<p>Veoh: Open. Personalized. Free. TV.</p>\n\n<p>Veoh is an Internet TV service that gives viewers the power to easily discover, watch, and personalize their online viewing experience.  </p>\n\n<p>With a simple broadband connection Veoh gives you free access to all of the great TV and film studio content, independent productions, and user-generated videos on the Web. From hit CBS, WB, NBC, FOX and MTV Networks shows to your favorite YouTube clips, Veoh turns the vast universe of Internet video into an easy-to-use, high-quality, personalized experience that TV fans everywhere can enjoy.  </p>\n\n<p>Who can publish on Veoh?</p>\n\n<p>Veoh is an open platform for content publishers of all sizes and sophistication who want to reach tomorrow&#8217;s television audience. Currently more than 100,000 publishers - from forward-thinking, well-known entertainment brands to independent, made-for-the-Web producers - use Veoh to connect with an audience of more than 28 million engaged, influential viewers. In addition, Veoh&#8217;s unique publisher optimization program gives publishers powerful tools to help them raise awareness of their content and cultivate loyal viewing audiences. </p>\n\n<p>Who&#8217;s behind Veoh?</p>\n\n<p>With offices in San Diego and Los Angeles, CA, Veoh is home to a diverse team of entertainment industry insiders, outsiders, technologists and creative types who share a common vision: To make Veoh the most valuable video experience on the Internet.  And like any good business, we have our fair share of suits &#8211; Veoh is privately held and backed by leading technology and media investors, including Shelter Capital Partners, Spark Capital, Michael Eisner&#8217;s Tornante Company, Goldman Sachs, Time Warner Inc., Intel Capital, Adobe Systems Incorporated, Gordon Crawford, Tom Freston and Jonathan Dolgen. </p>",
