    "overview" : "<p>JotSpot provides structured wiki software for small to medium-sized businesses. The company was founded by two co-founders of Excite and was sold to <a href=\"http://www.crunchbase.com/company/google\" title=\"Google\">Google</a> in 2006. </p>\n\n<p>JotSpot has been closed to new registrations since its acquisition.</p>\n\n<p>On February 27th, 2008, <a href=\"http://www.techcrunch.com/2008/02/27/it-took-16-months-but-google-relaunches-jotspot/\" title=\"Google relaunched JotSpot\">Google relaunched JotSpot</a> as part of the Google Apps team, renaming JotSpot to <a href=\"http://www.crunchbase.com/product/google-sites/\" title=\"Google Sites\">Google Sites</a>.</p>\n\n<p><a href=\"http://www.crunchbase.com/person/joe-kraus\" title=\"Joe Kraus\">Joe Kraus</a> and <a href=\"http://www.crunchbase.com/person/graham-spencer\" title=\"Graham Spencer\">Graham Spencer</a> co-founders of Jotspot joined Google with the acquisition. </p>",
