    "deadpooled_url" : "http://venturebeat.com/2008/05/07/internet-phone-company-jangl-to-sell-assets-core-team-goes-to-competitor-jajah/",
    "tag_list" : "buzzage, jangl, voice, call, email",
    "alias_list" : "",
