    "description" : "",
    "created_at" : "Tue Feb 05 22:28:14 UTC 2008",
    "updated_at" : "Tue Dec 17 20:40:03 UTC 2013",
    "overview" : "<p>Jangl allows consumers to exchange text messages, phone calls and voicemail without sharing their real numbers.</p>\n\n<p>Jangl customers can send/receive SMS messages from their mobile device or their Jangl account online, have voice messages sent directly to their email or profile inbox as MP3 files, and block contact from someone at any time, among other capabilities.</p>\n\n<p>Jangl provides its services to users of Facebook (JanglMe application), Bebo, Plentyoffish.com, Match.com, Friendster, Tagged, FriendFinder, Fubar, and more, and also offers its services at Jangl.com.</p>\n\n<p>In late 2007, Jangl began testing a variety of ad placements in phone calls and SMS messages. One of its most recently partners - dating site Plentyoffish.com - will be a free service supported entirely by advertising. This advertising revenue stream will be Jangl&#8217;s second, as the company has already been generating partner revenue since January 2007.</p>\n\n<p>In May 2008, it was revealed that the company&#8217;s two founders had left for <a href=\"http://www.crunchbase.com/company/jajah\" title=\"Jajah\">Jajah</a>. Jangl assets were then sold to LiveUniverse and some of the Jangl employees were then employed by LiveUniverse, Jangl is still operational. This came after it spent months trying to find an acquirer following the board&#8217;s insistence that it do so in late fall 2007.</p>\n\n<p>Competitors/similar companies include: <a href=\"http://www.crunchbase.com/company/jaxtr\" title=\"Jaxtr\">Jaxtr</a>, <a href=\"http://www.crunchbase.com/company/grandcentral\" title=\"GrandCentral\">GrandCentral</a>, and <a href=\"http://www.crunchbase.com/company/tringme\" title=\"TringMe\">TringMe</a>.</p>",
