    "description" : "Awesome Photo & Video Sharing",
    "created_at" : "Fri Dec 07 16:02:18 UTC 2007",
    "updated_at" : "Fri Oct 04 17:20:52 UTC 2013",
    "overview" : "<p>SmugMug is not your typical Web 2.0 photo sharing site. It&#8217;s not free, there are no ads, the company is self funded, and has been profitable for over three years. SmugMug is geared more towards professional photographers with features such as watermarking, selling downloads and prints, and creating galleries of photos. Users can even use their own domain names for these galleries. SmugMug still has the more typical Web 2.0 photo sharing features like RSS feeds, tags, and a public API. More recently, SmugMug has added functionality to automatically scale the size of photos to the viewing size of the browser. Smug also supports HD quality video uploading.</p>\n\n<p>Competitors include: <a href=\"http://www.crunchbase.com/company/flickr\" title=\"Flickr\">Flickr</a>, <a href=\"http://www.crunchbase.com/company/Photobucket\" title=\"Photobucket\">Photobucket</a>, <a href=\"http://www.crunchbase.com/company/webshots\" title=\"Webshots\">Webshots</a>, <a href=\"http://www.crunchbase.com/company/fotki\" title=\"Fotki\">Fotki</a>, <a href=\"http://www.techcrunch.com/2006/04/06/the-photo-gunners/#comment-25698\" title=\"BubbleShare\">BubbleShare</a>, <a href=\"http://www.crunchbase.com/company/Zenfolio\" title=\"Zenfolio\">Zenfolio</a>, <a href=\"http://www.crunchbase.com/company/zooomr\" title=\"Zoomr\">Zoomr</a>, and <a href=\"http://www.crunchbase.com/company/facebook\" title=\"Facebook\">Facebook</a>.</p>",
