    "created_at" : "Thu Jun 21 05:11:38 UTC 2007",
    "updated_at" : "Thu Dec 05 23:43:10 UTC 2013",
    "overview" : "<p>Prosper is America&#8217;s first peer-to-peer lending marketplace, with more than 1.9 million members and over $632,000,000 in funded loans. </p>\n\n<p>Prosper allows people to invest in each other in a way that is financially and socially rewarding. On Prosper, borrowers list loan requests between $2,000 and $35,000 and individual lenders invest as little as $25 in each loan listing they select. In addition to credit scores, ratings, and histories, investors can consider borrowers&#8217; personal loan descriptions, endorsements from friends, and community affiliations. Prosper handles the servicing of the loan on behalf of the matched borrowers and investors. </p>\n\n<p>Prosper Marketplace, Inc. is run by CEO, Stephan Vermut, President, Aaron Vermut, and Head of Global Institutional Sales, Ron Suber. Steve and Aaron Vermut are the founders and former managing partners of Merlin Securities, a prime brokerage service based on cutting-edge technology. Prosper Marketplace, Inc.’s investors include Sequoia Capital and BlackRock.</p>\n\n<p>Prosper Marketplace, Inc. is using the Prosper logo and brand with the permission of its wholly-owned subsidiary, Prosper Funding LLC.</p>",
