    "description" : "IP Communications Platform",
    "created_at" : "Mon Jul 02 19:53:59 UTC 2007",
    "updated_at" : "Thu May 09 17:14:48 UTC 2013",
    "overview" : "<p>Jajah is a VoIP service that gives you lower long distance rates by bridging standard phone lines with a cheaper VoIP alternative. You can place Jajah calls by clicking on your contacts through their website (desktop and mobile), various browser plugins, or Google Gadget. You can try out a one time call by going to Jajah and typing in your email address and your contacts info. When you initiate a call by clicking on a contact, Jajah calls back your phone and your contact&#8217;s phones. The call is then routed through your phone network (landline or mobile), to Jajah&#8217;s servers, and then back out through your contact&#8217;s phone.</p>\n\n<p>There is no headset, no download, no software and no broadband connection needed. You are using your existing phone and so is the person you are calling. You can call any phone anywhere in the world without the need of an international calling plan.</p>\n\n<p>Jajah also allows you to get a local number for each of your international contacts. This allows you to save this number in your address book and dial the local number from any land line or mobile, it will ring the person&#8217;s phone anywhere in the world.</p>\n\n<p>Jajah combines the best of two worlds: Premium voice quality of a standard land line or cell phone and the cost savings of Internet telephony.</p>",
